def update(other_hash)
  @cookies.update other_hash.stringify_keys
  self
end

def []=(name, options)
  if options.is_a?(Hash)
    options.symbolize_keys!
    value = options[:value]
  else
    value = options
    options = { value: value }
  end

  handle_options(options)

  if @cookies[name.to_s] != value || options[:expires]
    @cookies[name.to_s] = value
    @set_cookies[name.to_s] = options
    @delete_cookies.delete(name.to_s)
  end

  value
end

def current_user
  @current_user ||= lookup_session_user
end

def anonymous_access?
  @anonymous_access
end

def accept_eula?
  @user.eula
end

def admin?
  @user.admin
end

def api_keys
  @api_keys ||= ApiKey.list(login)
end

def orgs
  @user.orgs.map(&:to_model)
end

def personal_org
  @personal_org ||= @user.personal_org.to_model
end

def self.find(session)
  Configuration.new.from_json(session[:configuration] || "{}")
end

def used?
  @api_key.last_used.present?
end

def personal?
  @org.name.nil?
end

def apps
  @apps ||= @org.apps_dataset.order(:name).map(&:to_list_item)
end
